  `case_code` char(255) DEFAULT NULL COMMENT '案件编号',
  `case_type` int(2) DEFAULT NULL COMMENT '案件类型',
  `video_title` varchar(255) DEFAULT NULL COMMENT '视频标题',
  `scsj` datetime DEFAULT NULL COMMENT '上传时间',
  `cjsj` datetime DEFAULT NULL COMMENT '采集时间',
